    this._webSocketCompat = window.WebSocket || window.MozWebSocket
  }

  render() {
    console.log(this._webSocketCompat)
    return (
      <>
        {this._webSocketCompat ? (
          <div>CouCou</div>
        ) : (
          <div>Your brother does not support WebSocket</div>
        )}
      </>
    )
  }
}

export default App
